  return <div className="app">
    <InstagramFeed token="IGQVJXamxqVmFBT2FVNTJPaEhmejFQNC14X2ZANNGRGVVZAOOUFtU3pjRFlaN1lualJQa0FCWDBWMTBHSlg2VmtyZAl9NV1U3RmZAGMmdISEpYeG1qSmJqdXhwcHZAuV3BMaWVmQTNIc3hreVVtVUdCMGo2SgZDZD"  counter="6"/>  
